  useEffect(() => {
    const complete = (event) => {
      window.removeEventListener("load", complete);
      if (window.webkit) {
        window.webkit.messageHandlers.pageStateHandler.postMessage(
          JSON.stringify({ state: "READY" })
        );
      } else if (window.AndroidWebViewHandler) {
        const response = event.data;
        if (response.type === "JWT_TOKEN_RESPONSE") {
          localStorage.setItem("loyalty_native_token", response.result);
        }
      } else {
        console.log("webkit or something undefined");
      }
    };

    if (document.readyState === "complete") {
      setTimeout(complete);
    } else {
      window.addEventListener("load", complete);
    }
  }, []);

  const handleThreeDataTypes = async () => {
    const text = new Blob(["https://ya.ru"], { type: "text/plain" });
    const html = new Blob(["Three Data Type"], { type: "text/html" });

    try {
      await navigator.clipboard.write([
        new ClipboardItem({
          "text/plain": text,
          "text/html": html,
          // "image/png": blob,
        }),
      ]);
      console.log("Данные записаны");
    } catch (err) {
      console.error("Ошибка записи:", err);
    }
  };

  const handleDataArray = async () => {
    const array = ["black", "white", "green"];
    const text = array.join(", ");

    try {
      const blob = new Blob([text], { type: "text/plain" });

      await navigator.clipboard.write([
        new ClipboardItem({
          "text/plain": blob,
        }),
      ]);
      console.log("Данные записаны");
    } catch (err) {
      console.error("Ошибка записи:", err);
    }
  };

